import React, {Component} from 'react';
import List from './List';
import Title from './Title';

class Main extends Component {
    render(){
      return(
        <div>
          <Title titleText={'List 1'}/>
          <List tasks ={['Task 1','Task 2']}/>

          <Title titleText={'List 2'}/>
          <List tasks ={['Taskkk 3','Taskkk 4']}/>

          <Title titleText={'List 3'}/>
          <List tasks ={['Taskk 5','Taskk 6']}/>

        </div>
      );
    }
  }

export default Main;
